function firstNPrimes(n){
    let primeArray = [];
    let counter = 1;

    while(n > 0){
        if(isPrime(counter)){
            primeArray.push(counter);
            n--;
        }

        counter++;
    }
    
    return primeArray;
}

function isPrime(n){
    if(n === 1){
        return false;
    }
    else{
        for(let i = 2; i <= Math.sqrt(n); i++){
            if(n % i === 0){
                return false;
            }
        }
    }
        
    return true;
}

