      break;
    }  
  }
 
  let diff = 1250.50 - points
  if (diff > 0) { 
    console.log(`Sorry, ${name} you need ${(diff).toFixed(1)} more!`)
  }
}

import java.util.*;
import java.io.*;
public class cannonball {
    public static void main(String[] args) throws IOException {
        BufferedReader br = new BufferedReader(new InputStreamReader(System.in));
        StringTokenizer st = new StringTokenizer(br.readLine());
        
        int n = Integer.parseInt(st.nextToken());
        int start = Integer.parseInt(st.nextToken())-1;
        int curLevel = 1;
        int curLoc = 0;
        int count = 0;
        
        Location[] locs = new Location[n];
        for(int i=0; i<n; i++) {
            st = new StringTokenizer(br.readLine());
            locs[i] = new Location();
            locs[i].type = Integer.parseInt(st.nextToken());
            locs[i].value = Integer.parseInt(st.nextToken());
        }
        
        String[] types = new String[n];
        for(int i=0; i<n; i++) {
            if(locs[i].type == 0) {
                types[i] = "pad";
            }
            else if(locs[i].type == 1) {
                types[i] = "target";
            }
        }
        
        curLoc = start;
        if(types[start] == "target" && locs[start].value == 1) {
            count++;
            types[start] = "";
            
        }
        while(true) {
            if(locs[curLoc].value <= Math.abs(curLevel) && types[curLoc] == "target") {
                types[curLoc] = "";
                count++;
            }
            else if(types[curLoc] == "pad") {
                if(curLevel > 0) {
                    curLevel += locs[curLoc].value;
                }
                else {
                    curLevel -= locs[curLoc].value;
                }
                
                curLevel *= (-1);
            }
            curLoc+= curLevel;
            if(curLoc > n-1 || curLoc < 0) {break;}
            
        }
        
        System.out.println(count);
    }
    
    static class Location {
        int type;
        int value;
    }
}

